var doc = new jsPDF();
var button = document.getElementById("generatePDF");
button.addEventListener('click', printPDF);

function printPDF() {
    //console.log('test');
    var imgData = 'data:image/png;base64,';
    doc.setFontSize(15);
    doc.addImage(imgData, 'PNG', 0, 0, 210, 290);

    doc.text(65, 131, document.getElementById("street_trees").value);
    doc.text(72, 141, document.getElementById("garden_trees").value);

    doc.text(150, 152, document.getElementById("girth_biggest_tree").value);
    doc.text(154, 164, document.getElementById("girth_smallest_tree").value);

    if (document.querySelector('input[name="squirrelTest"]:checked') !== null) {
        if (document.querySelector('input[name="squirrelTest"]:checked').value == "NoSquirrel") {
            doc.text(90, 229, "No");
            doc.text(60, 247, document.getElementById("gap_in_canopies").value);
        }

        else if (document.querySelector('input[name="squirrelTest"]:checked').value == "YesSquirrel") {
            doc.text(90, 229, "Yes");
        }
    }

    doc.save('Urban Forest Quest.pdf');
}

function squirrelChanged(squirrel){
    if(squirrel.value == "YesSquirrel"){
      document.getElementById("canopyGap").style.display = "none";
      document.getElementById("noTest").style.marginBottom = "5px";
    }
    else{
      document.getElementById("canopyGap").style.display = "inline";
      document.getElementById("noTest").style.marginBottom = "-10px";
    }
}